# Approach 1- rabin karp
def compute_encoding(s):
    allUniqueChars = list(set(s))
    return {allUniqueChars[i]: str(i) for i in range(len(allUniqueChars))}


def compute_hash(encodingMap, window, previousWindowHash, previousWindowFirstChar):
    if previousWindowHash == "" or previousWindowFirstChar == None:
        hash = ""
        for ch in window:
            hash += encodingMap[ch]
        return hash
    else:
        hashForFirstChar = encodingMap[previousWindowFirstChar]
        hashForLastChar = encodingMap[window[-1]]
        previousWindowHash += hashForLastChar
        return previousWindowHash[len(hashForFirstChar):]


def rabin_karp(t: str, s: str) -> int:
    # do precomputation and get the hash value for each window of length |s| -> use integer encoding
    encodingMap = compute_encoding(t + s)

    # get hash of the search string
    sHash = compute_hash(encodingMap, s, "", None)

    # do sliding window hash comparison and if the hashes match then go ahead and do the string comparison
    n = len(t)
    m = len(s)
    windowHash = ""
    previousWindowFirstChar = None
    for i in range(n - m + 1):
        window = t[i: i + m]
        if i > 0:
            previousWindowFirstChar = t[i - 1]
        windowHash = compute_hash(encodingMap, window, windowHash, previousWindowFirstChar)
        if sHash == windowHash and s == window:
            return i
    return -1


# Approach 2 - kmp
# idea: smartly skip based on longest prefix which is also a suffix
def construct_prefix(s):
    i = 0
    j = 1
    prefixes = []
    if len(s) > 0:
        prefixes.append(0)
    while j < len(s):
        if s[i] == s[j]:
            prefixes.append(i + 1)
            i += 1
            j += 1
        elif i == 0:
            prefixes.append(0)
            i = 0
            j += 1
        else:
            while s[i] != s[j] and i > 0:
                i = prefixes[i - 1]

            if s[i] == s[j]:
                # we find the tiniest prefix so put the one after that
                prefixes.append(i + 1)
                i += 1
                j += 1
            else:
                # no prefixes at all
                prefixes.append(0)
                i = 0
                j += 1

    return prefixes


def kmp(t, s):
    # do precomputation for prefix array
    prefixes = construct_prefix(s)

    # using prefix array do the searching
    n = len(t)
    m = len(s)
    i = 0
    j = 0
    while i <= n - m:
        # match char by char
        while j < m and t[i + j] == s[j]:
            j += 1

        # if all match
        if j == m:
            return i
        elif j > 0:
            # get the prefix from the prefix array for the previous one which didnt match
            j = prefixes[j - 1]
        i += 1

    return -1


